INSERT INTO `email_sistema` VALUES (1,'Envio de processo para unidade','@sigla_sistema@ <@email_sistema@>','@emails_unidade@','Processo Remetido','\r\n\r\nO processo @processo@ (@tipo_processo@) foi remetido pela unidade @sigla_unidade_remetente@/@sigla_orgao_unidade_remetente@ para a unidade @sigla_unidade_destinataria@/@sigla_orgao_unidade_destinataria@.\r\n\r\n','S'),(2,'Concessão de credencial em processo sigiloso','@sigla_sistema@ <@email_sistema@>','@emails_unidade@','Concessão de Credencial','\r\n\r\nO usuário @sigla_usuario_credencial@ recebeu uma credencial de acesso em processo na unidade @sigla_unidade_credencial@/@sigla_orgao_unidade_credencial@ do @sigla_sistema@.\r\n\r\nFavor verificar o Controle de Processos.\r\n\r\n','S'),(3,'Concessão de credencial de assinatura em processo sigiloso','@sigla_sistema@ <@email_sistema@>','@emails_unidade@','Concessão de Credencial de Assinatura','\r\nO usuário @sigla_usuario_credencial@ recebeu uma credencial de assinatura em documento na unidade @sigla_unidade_credencial@/@sigla_orgao_unidade_credencial@ do @sigla_sistema@.\r\n\r\nFavor verificar o Controle de Processos.\r\n\r\n','S'),(4,'Disponibilização de acesso externo','@email_unidade@','@email_destinatario@','Acesso Externo ao Processo SEI @processo@','\r\nEsta mensagem fornece acesso ao Processo Administrativo Nº @processo@ do Sistema Eletrônico de Informações e é destinada para @nome_destinatario@.\r\n\r\nO acesso será válido até @data_validade@ e poderá ser realizado através do link abaixo:\r\n\r\n@link_acesso_externo@\r\n\r\n\r\nATENÇÃO: A informação contida nesta mensagem de e-mail, incluindo quaisquer anexos, pode ser confidencial e estar reservada apenas à pessoa ou entidade para a qual foi endereçada. Se você não é o destinatário ou a pessoa responsável por encaminhar esta mensagem ao destinatário, você está, por meio desta, notificado que não deverá rever, retransmitir, imprimir, copiar, usar ou distribuir esta mensagem de e-mail ou quaisquer anexos. Caso você tenha recebido esta mensagem por engano, por favor, contate o remetente imediatamente e apague esta mensagem de seu computador ou de qualquer outro banco de dados.\r\n\r\n@descricao_orgao@\r\n@sitio_internet_orgao@\r\n\r\n','S'),(5,'Disponibilização de acesso externo em processo para usuário externo','@email_unidade@','@email_usuario_externo@','Acesso Externo ao Processo SEI @processo@','\r\nEsta mensagem informa a liberação de acesso externo ao Processo Administrativo Nº @processo@ do Sistema Eletrônico de Informações para o usuário externo @nome_usuario_externo@ (@email_usuario_externo@).\r\n\r\nPara visualização, acesse a área destinada aos usuários externos no nosso site ou clicando no link abaixo:\r\n\r\n@link_login_usuario_externo@\r\n\r\nATENÇÃO: A informação contida nesta mensagem de e-mail, incluindo quaisquer anexos, pode ser confidencial e estar reservada apenas à pessoa ou entidade para a qual foi endereçada. Se você não é o destinatário ou a pessoa responsável por encaminhar esta mensagem ao destinatário, você está, por meio desta, notificado que não deverá rever, retransmitir, imprimir, copiar, usar ou distribuir esta mensagem de e-mail ou quaisquer anexos. Caso você tenha recebido esta mensagem por engano, por favor, contate o remetente imediatamente e apague esta mensagem de seu computador ou de qualquer outro banco de dados.\r\n\r\n@descricao_orgao@\r\n@sitio_internet_orgao@\r\n\r\n','S'),(6,'Disponibilização para assinatura externa em documento para usuário externo','@email_unidade@','@email_usuario_externo@','Liberação de Assinatura Externa no Processo SEI @processo@','\r\nEsta mensagem informa a liberação para assinatura externa do documento @documento@ (@tipo_documento@) pelo usuário @nome_usuario_externo@ (@email_usuario_externo@) no Sistema Eletrônico de Informações.\r\n\r\nPara assinar, acesse a área destinada aos usuários externos no nosso site ou clicando no link abaixo:\r\n\r\n@link_login_usuario_externo@\r\n\r\nATENÇÃO: A informação contida nesta mensagem de e-mail, incluindo quaisquer anexos, pode ser confidencial e estar reservada apenas à pessoa ou entidade para a qual foi endereçada. Se você não é o destinatário ou a pessoa responsável por encaminhar esta mensagem ao destinatário, você está, por meio desta, notificado que não deverá rever, retransmitir, imprimir, copiar, usar ou distribuir esta mensagem de e-mail ou quaisquer anexos. Caso você tenha recebido esta mensagem por engano, por favor, contate o remetente imediatamente e apague esta mensagem de seu computador ou de qualquer outro banco de dados.\r\n\r\n@descricao_orgao@\r\n@sitio_internet_orgao@\r\n\r\n','S'),(7,'Cadastro de usuário externo','@sigla_sistema@ <@email_sistema@>','@email_usuario_externo@','Cadastro de Usuário Externo no SEI','\r\nSua solicitação de cadastro como usuário externo no SEI – Sistema Eletrônico de Informações foi recebida em nossa base de dados.\r\n\r\nPara ativar seu login, será necessário encaminhar cópia dos seguintes documentos:\r\n\r\n- RG\r\n- CPF\r\n- COMPROVANTE DE ENDEREÇO RESIDENCIAL\r\n\r\nO e-mail para envio, bem como para obter mais informações, é XXXXXXXXXX ou entre em contato pelo telefone (XX) XXXXXXXXXXX.\r\n\r\nATENÇÃO: A informação contida nesta mensagem de e-mail, incluindo quaisquer anexos, pode ser confidencial e estar reservada apenas à pessoa ou entidade para a qual foi endereçada. Se você não é o destinatário ou a pessoa responsável por encaminhar esta mensagem ao destinatário, você está, por meio desta, notificado que não deverá rever, retransmitir, imprimir, copiar, usar ou distribuir esta mensagem de e-mail ou quaisquer anexos. Caso você tenha recebido esta mensagem por engano, por favor, contate o remetente imediatamente e apague esta mensagem de seu computador ou de qualquer outro banco de dados.\r\n\r\n@descricao_orgao@\r\n@sitio_internet_orgao@\r\n\r\n','S'),(8,'Geração de senha para usuário externo','@sigla_sistema@ <@email_sistema@>','@email_usuario_externo@','Sistema SEI - Geração de Senha','\r\nSua solicitação para geração de uma nova senha de acesso externo foi processada.\r\n\r\nSua nova senha é: @nova_senha_usuario_externo@\r\n\r\nPara alterá-la acesse a área destinada aos usuários externos clicando no link abaixo:\r\n\r\n@link_login_usuario_externo@\r\n\r\nATENÇÃO: A informação contida nesta mensagem de e-mail, incluindo quaisquer anexos, pode ser confidencial e estar reservada apenas à pessoa ou entidade para a qual foi endereçada. Se você não é o destinatário ou a pessoa responsável por encaminhar esta mensagem ao destinatário, você está, por meio desta, notificado que não deverá rever, retransmitir, imprimir, copiar, usar ou distribuir esta mensagem de e-mail ou quaisquer anexos. Caso você tenha recebido esta mensagem por engano, por favor, contate o remetente imediatamente e apague esta mensagem de seu computador ou de qualquer outro banco de dados.\r\n\r\n@descricao_orgao@\r\n@sitio_internet_orgao@\r\n\r\n','S'),(9,'Contato com Ouvidoria','@sigla_orgao@ <no-reply@@sigla_orgao_minusculas@@sufixo_email@>','@nome_contato@ <@email_contato@>','Contato com OUVIDORIA/@sigla_orgao@','\r\nEste é um e-mail automático.\r\n\r\nSeu contato foi recebido pela OUVIDORIA/@sigla_orgao@ e registrado no Processo Administrativo @processo@ (@tipo_processo@).\r\n\r\nA resposta será encaminhada, com a maior brevidade possível, para este endereço de e-mail.\r\n\r\n@conteudo_formulario_ouvidoria@\r\n','S');
/*!40000 ALTER TABLE `email_sistema` ENABLE KEYS */;
